import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import {HomeComponent} from "./home/home.component";
import {HomeAdminComponent} from "./admin/home-admin/home-admin.component";
import {VipAccountComponent} from "./admin/vip-account/vip-account.component";
import {NormalAccountComponent} from "./admin/normal-account/normal-account.component";

const routes: Routes = [
  {path:"", component: HomeComponent},
  {path:"admin", component: HomeAdminComponent},
  {path:"admin/account/vip", component: VipAccountComponent},
  {path:"admin/account/normal", component: NormalAccountComponent},
  {path:"admin/account/blocked", component: VipAccountComponent},
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
